import React from 'react';
import "./_mapSection.scss";

const MapSection = () => {
    return (
        <>
            <section className="map">
                <div className="map_container container">
                    <h1 className="map_header">Mapa interesujacych miejsc dla motocyklistow z:</h1>
                    <ul className="map_list">
                        <li>okolic Warszawy</li>
                        <li>okolic Lublina</li>
                        <li>okolic Mazur, głównie wokół Giżycka</li>
                        <li>oraz różnych miejsc odwiedzonych na dłuższych trasach</li>
                    </ul>
                </div>

                <iframe className="mapSection" src="https://www.google.com/maps/d/embed?mid=14TaonPkOlJyziG2HBBmH6b8uaiaBaro&ehbc=2E312F"></iframe>
            </section>
        </>
    );
};

export default MapSection;
